                    t.style.borderColor = d("pointerColor");
                    if (l) {
                        t.style.padding = d("ringClickSize") + "px";
                    } else {
                        t.style.padding = d("ringSize") + "px";
                    }
                    e.style.transform = `translate(${i}px, ${n}px)`;
                    t.style.transform = `translate(${o - (l ? d("ringClickSize") : d("ringSize"))}px, ${a - (l ? d("ringClickSize") : d("ringSize"))}px)`;
                    requestAnimationFrame(u);
